import React, { Component } from "react";
import getMovies from "./movie_list";

export class Movies extends Component {
  constructor() {
    super();
    this.state = {
      movie: getMovies()
    };
  }

  render() {
    return (
      <div>
        <h1>Showing {this.state.movie.length} movies in the database</h1>
        <table>
          <thead>
            <tr>
              <td></td>
            </tr>
          </thead>
          <tbody></tbody>
        </table>
      </div>
    );
  }
}

export default Movies;
